console.log('===CIBOZER DIAGNOSTIC TOOL===');window.addEventListener('DOMContentLoaded',()=>{console.log('DOM Content Loaded');if(typeof $!=='undefined'){console.log('jQuery version:',$.fn.jquery)}if(typeof bootstrap!=='undefined'){console.log('Bootstrap loaded:',bootstrap.VERSION||'unknown version')}const clickables=document.querySelectorAll('button,a,input[type="submit"],.btn');console.log(`Found ${clickables.length}clickable elements`);clickables.forEach((el,index)=>{const rect=el.getBoundingClientRect();const computed=window.getComputedStyle(el);const isVisible=rect.width>0&&rect.height>0&&computed.display!=='none';const isClickable=computed.pointerEvents!=='none';if(!isVisible||!isClickable){console.warn(`Element ${index}might not be clickable:`,{element:el,text:el.textContent.trim().substring(0,50),visible:isVisible,clickable:isClickable,display:computed.display,pointerEvents:computed.pointerEvents,position:computed.position,zIndex:computed.zIndex})}});document.addEventListener('mousedown',(e)=>{console.log('===CLICK DIAGNOSTIC===');console.log('Click at:',e.clientX,e.clientY);const elements=document.elementsFromPoint(e.clientX,e.clientY);console.log('Elements under cursor(top to bottom):');elements.forEach((el,index)=>{const computed=window.getComputedStyle(el);console.log(`${index}:${el.tagName}.${el.className}`,{id:el.id,pointerEvents:computed.pointerEvents,position:computed.position,zIndex:computed.zIndex,cursor:computed.cursor})});console.log('===END DIAGNOSTIC===')},true);const originalError=console.error;console.error=function(...args){console.log('===ERROR DETECTED===');originalError.apply(console,args);console.log('===END ERROR===')};console.log('Diagnostic tool loaded. Click anywhere to see diagnostic info.')});